import React, { useEffect, useState } from "react"
import Table from 'react-bootstrap/Table';

function Users()
{
    const [users, setUsers] = useState([]);
    const [datas, setDatas] = useState([]);

    const fetchUserData = () => {
        fetch("https://jsonplaceholder.typicode.com/users")
        .then(response => {
            return response.json()
        })
        .then(data => {
            setUsers(data)
        })
    };

    const fetchNewData = () => {
        fetch("https://reqres.in/api/posts")
        .then(response => {
            return response.json()
        })
        .then(data => {
            setDatas(data)
        })
    };

    useEffect(() => {
        fetchUserData();
        fetchNewData();
        console.log(datas);
    }, []);

    return(
        <>
            <h1>Users </h1>

            {users.length > 0 && (
                <Table  striped bordered hover size="sm">
                    <thead>
                        <tr>
                            <th>#</th>
                            <th>Name</th>
                            <th>Email</th>
                            <th>Username</th>
                        </tr>
                    </thead>
                    <tbody>
                    {users.map(user => (
                        <tr key={user.id}>
                            <td>{user.id}</td>
                            <td>{user.name}</td>
                            <td>{user.email}</td>
                            <td>{user.username}</td>
                        </tr>
                    ))}
                    </tbody>
                </Table>
            )}
        </>
    )
}

export default Users;
